import { Link } from "react-router-dom";
import './Menu.css';


const HomePage = () => {
  return (
        <div className="menu">
      <Link to="/">Главное</Link>
      <Link to="/top-places">Топ мест</Link>
      <Link to="/useful-info">Полезное</Link>
      <Link to="/about">О нас</Link>
    </div>
  );
};

export default HomePage;
